import React, { Component } from "react";
import { Link } from "React-scroll";

class nav extends Component {
    state = {};
    render() {
        return (
            <div className="navbar">

            <ul>
            <Link
            activeClass="active"
            to="section1"
            spy={true}
            smooth={true}    offset={-70}  duration={500} />
            </ul>

            </div>
        )
    }
}
